 import React,{useState} from 'react'
 
 const Register = () => {
const[email,setemail]=useState('');
     const registerform=()=>{
         const handleClick=()=>{

         }
         <form onSubmit={handleClick}>
             <input
             type='email'
             className='form-control'
             value={email}
             onChange={e=>{setemail(e.target.value)}}
             ></input>

         </form>

     }
     return (
         <>
        <div className="container p-5 " style={{fontWeight:"bold",fontSize:"30px"}} >Register</div>
        {registerform()}

         </>
     )
 }
 
 export default Register
